import React, { useState } from 'react';

const UserTable = () => {
  const [users, setUsers] = useState([
    { id: 1, nom: 'Dupont', email: 'dupont@example.com', tel: '123456789' },
    { id: 2, nom: 'Martin', email: 'martin@example.com', tel: '987654321' },
  ]);

  const [filter, setFilter] = useState('');
  const [form, setForm] = useState({ nom: '', email: '', tel: '' });
  const [editId, setEditId] = useState(null);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleAdd = () => {
    if (form.nom && form.email && form.tel) {
      const newUser = {
        id: Date.now(),
        ...form,
      };
      setUsers([...users, newUser]);
      setForm({ nom: '', email: '', tel: '' });
    }
  };

  const handleEdit = (user) => {
    setEditId(user.id);
    setForm({ nom: user.nom, email: user.email, tel: user.tel });
  };

  const handleUpdate = () => {
    setUsers(
      users.map((u) =>
        u.id === editId ? { ...u, nom: form.nom, email: form.email, tel: form.tel } : u
      )
    );
    setEditId(null);
    setForm({ nom: '', email: '', tel: '' });
  };

  const handleDelete = (id) => {
    setUsers(users.filter((u) => u.id !== id));
  };

  const filteredUsers = users.filter(
    (u) =>
      u.nom.toLowerCase().includes(filter.toLowerCase()) ||
      u.email.toLowerCase().includes(filter.toLowerCase())
  );

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Gestion des utilisateurs</h2>

      <input
        type="text"
        placeholder="Filtrer par nom ou email"
        value={filter}
        onChange={(e) => setFilter(e.target.value)}
        style={styles.input}
      />

      <div style={styles.form}>
        <input
          type="text"
          name="nom"
          placeholder="Nom"
          value={form.nom}
          onChange={handleChange}
          style={styles.input}
        />
        <input
          type="email"
          name="email"
          placeholder="Email"
          value={form.email}
          onChange={handleChange}
          style={styles.input}
        />
        <input
          type="text"
          name="tel"
          placeholder="Téléphone"
          value={form.tel}
          onChange={handleChange}
          style={styles.input}
        />
        {editId ? (
          <button onClick={handleUpdate} style={styles.buttonUpdate}>Modifier</button>
        ) : (
          <button onClick={handleAdd} style={styles.buttonAdd}>Ajouter</button>
        )}
      </div>

      <table style={styles.table}>
        <thead>
          <tr>
            <th style={styles.th}>Nom</th>
            <th style={styles.th}>Email</th>
            <th style={styles.th}>Téléphone</th>
            <th style={styles.th}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {filteredUsers.map((user) => (
            <tr key={user.id}>
              <td style={styles.td}>{user.nom}</td>
              <td style={styles.td}>{user.email}</td>
              <td style={styles.td}>{user.tel}</td>
              <td style={styles.td}>
                <button onClick={() => handleEdit(user)} style={styles.buttonEdit}>
                  Modifier
                </button>
                <button onClick={() => handleDelete(user.id)} style={styles.buttonDelete}>
                  Supprimer
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

// CSS en JS
const styles = {
  container: {
    maxWidth: '800px',
    margin: '30px auto',
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
    backgroundColor: '#f9f9f9',
    borderRadius: '10px',
    boxShadow: '0 0 10px rgba(0,0,0,0.1)',
  },
  title: {
    textAlign: 'center',
    marginBottom: '20px',
  },
  form: {
    display: 'flex',
    gap: '10px',
    marginBottom: '20px',
    flexWrap: 'wrap',
  },
  input: {
    padding: '10px',
    fontSize: '16px',
    flex: '1',
    border: '1px solid #ccc',
    borderRadius: '5px',
  },
  buttonAdd: {
    padding: '10px 20px',
    backgroundColor: '#28a745',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
  },
  buttonUpdate: {
    padding: '10px 20px',
    backgroundColor: '#007bff',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
  },
  buttonEdit: {
    marginRight: '10px',
    padding: '5px 10px',
    backgroundColor: '#ffc107',
    color: '#333',
    border: 'none',
    borderRadius: '4px',
    cursor: 'pointer',
  },
  buttonDelete: {
    padding: '5px 10px',
    backgroundColor: '#dc3545',
    color: 'white',
    border: 'none',
    borderRadius: '4px',
    cursor: 'pointer',
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse',
  },
  th: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '10px',
    textAlign: 'left',
  },
  td: {
    padding: '10px',
    borderBottom: '1px solid #ddd',
  },
};

export default UserTable;
